import styled from "styled-components";
import MainSecApp from './MainSecApp';
import MainSecAppImg from './MainSecAppImg';
import MainSecAppButton from './MainSecAppButton'
import { GlobalSection } from "../../stylesGlobal";

GlobalSection = styled(GlobalSection)`
    flex-direction: row;
`

const SectionCTA = styled.section`
    width: 100%;
    margin: 0 auto;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    position: relative;
`

function Section03() {
    return (
        <GlobalSection id="app">
            <MainSecApp />
            <MainSecAppImg />
            <MainSecAppButton />
        </GlobalSection>
    )
}

export default Section03
